using namespace std;

void write(string filename , vector<int> arr){
	ofstream fout;
	fout.open(filename);
	int cnt = 0;
	int height = 170;
	int width = 380;
	for(int i = 0; i<height; ++i){
		for(int j = 0; j<width; ++j){
			fout << arr[cnt]<<" ";
			cnt++;
		}fout << "\n";
	}
	fout.close();
}

